class Footer extends Component {
  render() {
    return (
      <div>
        <footer>
        <ul>
          <li>Waffely You</li>
          <li>08-643 78 78</li>
          <li>Norrtullsgatan 5</li>
          <li>113 29 Stockholm</li>
          </ul>
        </footer>
      </div>

      )
  }
}

export default Footer;
